window.bookSummaryJSON = "<p>The decision to start a new life is never an easy one, but for Joe the transition was far from figurative. Becoming a permanent addition to a game world, it doesn't take long to learn that people with his abilities are actively hunted. In fact, if the wrong people gained knowledge of what he was capable of, assassins would appear in droves.&nbsp;</p> <p>In his pursuit of power, Joe fights alongside his team, completes quests, and delves into the mysteries of his class, which he quickly discovers can be practiced only in secret. Ultimately, his goal is to complete every mission, master every ability, and learn all of the world's secrets. All he has to do is survive long enough to make that happen.</p>"; 
